import React from 'react';
import Faker from '../node_modules/faker';

let recipies=[];
const size = 10;
for(let i=0;i<size;i++){
    let firstName = Faker.name.firstName();
    recipies.push(firstName);
}

const Home = ()=>{

    let items = recipies.map(item =>{
        return <li>{item}</li>
    })

    return(
        <div>
            <h1>Recepies</h1>
            <ul>
                {items}
            </ul>


            <Link href="/b" as="/a"><a>Go to B</a></Link>
            <Link href="/a" as="/a"><a>Go to A</a></Link>
        </div>
    )
}

export default Home;
